import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { connect } from "react-redux";
import React, { useEffect, useState, useRef } from 'react';
import defaultLogo from '../../img/defaultLogo.jpg'

const StatisticsCard = (props) => {
    useEffect(() => {
        debugger;
    }, [])
    return (
        <Card sx={{ maxWidth: 345 }}>
            <CardMedia
                component="img"
                height="140"
                image={`url('${props.logo||defaultLogo}')`}
                alt="green iguana"
            />
            <CardContent>
                <Typography gutterBottom variant="h5" component="div">{props.title}</Typography>
                <Typography variant="body2" color="text.secondary">{props.content}</Typography>
            </CardContent>
            <CardActions>
                <Button size="small">Share</Button>
                <Button size="small">Learn More</Button>
            </CardActions>
        </Card>
    );
}
const mapStateToProps = state => {
    return {
    }
}
export default connect(mapStateToProps, {})(StatisticsCard);
